import s from "./Dialogs.module.css"
import { NavLink } from "react-router-dom"
import DialogItem from "./DialogItem.js/DialogItex"

const Message = (props) => {
  return <div className={s.dialog}>{props.message}</div>
}

const Dialogs = () => {
  const dials = [
    { id: 1, name: "Damba" },
    { id: 2, name: "Vadim" },
    { id: 3, name: "Odel" },
    { id: 4, name: "Ortem" },
    { id: 5, name: "Ya" },
    { id: 6, name: "Test" },
  ]
  let dialogsElements = dials.map((elem) => (
    <DialogItem name={elem.name} id={elem.id} />
  ))

  const messages = [
    { message: "Hello" },
    { message: "How are you?" },
    { message: "Damba loh" },
  ]
  let messageElements = messages.map((elem) => (
    <Message message={elem.message} />
  ))
  return (
    <div className={s.dialogs}>
      <div className={s.dialogItems}></div>
      <div className={s.messages}>{messageElements}</div>
    </div>
  )
}

export default Dialogs
